import React, { useState } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from 'react-router-dom'
import { HomeOutlined } from '@ant-design/icons'
import { Menu, SubMenu } from 'antd'
import classes from './MenuHome.module.css'

const MenuHome = () => {
  const [currentPage, setCurrentPage] = useState('home')
  const handleClick = () => {
    console.log('Clicked !!!')
  }
  const BecomeATeacher = () => {
    return <h2>BecomeATeacher</h2>
  }
  const Home = () => {
    return (
      <Menu onClick={handleClick} selectedKeys={[currentPage]} mode="horizontal">
        <Menu.Item key="mail" icon={<HomeOutlined />}>
          Navigation One
        </Menu.Item>
        <Menu.Item key="app" icon={<HomeOutlined />}>
          Navigation Two
        </Menu.Item>
        <SubMenu
          key="SubMenu"
          icon={<HomeOutlined />}
          title="Courses"
        >
          <Menu.ItemGroup title="Item 1">
            <Menu.Item key="setting:1">Option 1</Menu.Item>
            <Menu.Item key="setting:2">Option 2</Menu.Item>
          </Menu.ItemGroup>
          <Menu.ItemGroup title="Item 2">
            <Menu.Item key="setting:3">Option 3</Menu.Item>
            <Menu.Item key="setting:4">Option 4</Menu.Item>
          </Menu.ItemGroup>
        </SubMenu>
        <Menu.Item key="alipay">
          <a href="https://ant.design" target="_blank" rel="noopener noreferrer">
            Navigation Four - Link
          </a>
        </Menu.Item>
      </Menu>
    )
  }

  const Account = () => {
    return <h2>Account</h2>
  }
  const Courses = () => {
    return <h2>Courses</h2>
  }
  const listMenu = [
    {
      id: 1,
      title: 'Home',
      link: '/',
    },
    {
      id: 2,
      title: 'Courses',
      link: '/courses',
    },
    {
      id: 3,
      title: 'Become a teacher',
      link: '/becomeateacher',

    },
    {
      id: 4,
      title: 'Account',
      link: '/account',
    },
  ]
  return (
    <Router>
      <div className={classes.AppHeaderMenu}>

        <Switch>
          <Route path="/" component={Home} />
          <Route path="/courses" component={Courses} />
          <Route path="/becomeateacher" component={BecomeATeacher} />
          <Route path="/account" component={Account} />
        </Switch>
      </div>
    </Router>
  )
}
export default MenuHome
